class Navbar extends Component {
  constructor(props) {
    super(props);

    this.routes = new Authservice()
  }
  logout (e) {
    e.preventDefault();
    this.routes.logout()
    .then(()=>{
      this.props.history.push('/')
    })

  }


  render() {
    return (
